import styles from './Projects.module.css'
import Button2 from '../elements/Button2'

function Projects(){
    return(
        <div id='Projects' className={styles.Image}>
         <h1>PROJETOS</h1>
         <p>Cars</p>
        <Button2 text='Acesse meu repositório' link='https://github.com/Ederchaves123?tab=repositories'/>
        </div>
    )
}

export default Projects
